use SPRING_TEST;

-- テーブルの削除
--DROP TABLE M_POST_CODE;

CREATE TABLE IF NOT EXISTS M_POST_CODE
(
    SEQ                INT           NOT NULL,
    POST_CODE          CHAR(7)       NOT NULL,
    FUKEN_CODE         CHAR(2)       NOT NULL,
    FUKEN              CHAR(10)      NOT NULL,
    SHIKUCHOSON_CODE   CHAR(5)       NOT NULL,
    SHIKUCHOSON        CHAR(50)      NOT NULL,
    CHOUIKI            CHAR(50),
    INS_USER_ID        VARCHAR(20)   NOT NULL,
    INS_DATE           TIMESTAMP(3)  NOT NULL DEFAULT CURRENT_TIMESTAMP(3),
    UPD_USER_ID        VARCHAR(20)   ,
    UPD_DATE           TIMESTAMP(3)  DEFAULT CURRENT_TIMESTAMP(3) ON UPDATE CURRENT_TIMESTAMP(3), /* 更新タイムスタンプ自動設定 */
    UPD_FUNC_ID        CHAR(12)      NOT NULL

) ENGINE=InnoDB;

